instance.peoplecode_text:
/**
* Provides a base class for data change events by CCTC as a template
* for the college to inherit/implement overrides to execute custom
* code for such events
*
* Note: The College must extend this class with the name 'CCTC_COLLEGE_PKG:CCTC_CollegeEventHandlers' for
* College Adaptor to properly pick it up and execute.
*
* @company CCC Tech Center
* @version CAv4.5.0
*/
class CCTC_EventHandlers
   method CCTC_EventHandlers();

   method onExampleChanged(&bindVars As array of any) Returns array of array of any;

   method onStandardAppInserted(&bindVars As array of any) Returns array of array of any;

   method onInternationalAppInserted(&bindVars As array of any) Returns array of array of any;

   method onStudentPlacementInserted(&bindVars As array of any) Returns array of array of any;

   method onPromiseGrantAppInserted(&bindVars As array of any) Returns array of array of any;

   method onSharedAppInserted(&bindVars As array of any) Returns array of array of any;

   method onEnrollmentRequestSubmitted(&bindVars As array of any) Returns array of array of any;

   method onRequestEnrollmentDropped(&bindVars As array of any) Returns array of array of any;

   method onFinAidUnitsInserted(&bindVars As array of any) Returns array of array of any;

   method onFinAidUnitsRemoved(&bindVars As array of any) Returns array of array of any;

   method onStudentCohortInserted(&bindVars As array of any) Returns array of array of any;

   method onStudentCohortRemoved(&bindVars As array of any) Returns array of array of any;

   method onStudentOrientationUpdated(&bindVars As array of any) Returns array of array of any;
end-class;

method CCTC_EventHandlers
   rem do nothing;
end-method;

/**
* This function is provided as an example to show inheritance
* for the college to implement their trigger

* @param &bindVars[1]: Some Id
*/
method onExampleChanged
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 1 Then
      Error "bindVars should have 1 element when handling the onExampleChanged event";
   End-If;

   Local string &someId = &bindVars [1];
   If None(&someId) Then
      Error "someId is required";
   End-If;

   Return CreateArray(CreateArrayAny(1));
end-method;

/**
* This function provides an stub for the College Adaptor to 
* execute custom college code when a Standard Application is Inserted
*
* This event is triggered just once after both these actions are complete:
* 1) a record is fully inserted into the PS_CCTC_APPL_STG table. 
* 2) the associated supplemental questions (if any) are inserted into the PS_CCTC_APPLSQ_STG table
* e.g. insert into PS_CCTC_APPL_STG completes, insert into PS_CCTC_APPLSQ_STG completes, event is triggered
*
* @param &bindVars[1]: Application Id
*/
method onStandardAppInserted
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 1 Then
      Error "bindVars should have 1 element when handling the onStandardAppInserted event";
   End-If;

   Local string &appid = &bindVars [1];
   If None(&appid) Then
      Error "appid is required";
   End-If;

   Return CreateArray(CreateArrayAny(1));
end-method;

