/**
* This function provides an stub for the College Adaptor to 
* execute custom college code when a Student Placement is Inserted
*
*This event is triggered once after data is inserted into PS_CCTC_PLCMT_STG
*
* @param &bindVars[1] : CCC ID
* @param &bindVars[2] : Statewide Student ID
* @param &bindVars[3] : College ID (misCode)
*/
method onStudentPlacementInserted
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 3 Then
      Error "bindVars should have 3 elements when handling the onStudentPlacementInserted event";
   End-If;

   Local string &cccid = &bindVars [1];
   If None(&cccid) Then
      Error "cccid is required";
   End-If;

   Local string &miscd = &bindVars [3];
   If None(&miscd) Then
      Error "miscd is required";
   End-If;

   Return CreateArray(CreateArrayAny(1));
end-method;

