/**
* This function provides an stub for the College Adaptor to 
* execute custom college code when a financial aid units record is inserted
*
* This event is triggered once after data is inserted into PS_CCTC_FA_UNT_STG
*
* @param &bindVars[1]: CCC ID
* @param &bindVars[2]: Term
* @param &bindVars[3]: College ID (ext mis code)
* @param &bindVars[4]: c-id
*/
method onFinAidUnitsInserted
   /+ &bindVars as Array of Any +/
   /+ Returns Array2 of Any +/

   If &bindVars.Len <> 4 Then
      Error "bindVars should have 4 elements when handling the onFinAidUnitsInserted event";
   End-If;

   If None(&bindVars [1]) Then
      Error "cccid is required";
   End-If;

   If None(&bindVars [2]) Then
      Error "term is required";
   End-If;

   If None(&bindVars [3]) Then
      Error "mis Code is required";
   End-If;

   If None(&bindVars [4]) Then
      Error "c-id is required";
   End-If;

   Return CreateArray(CreateArrayAny(1));
end-method;

